import http from './httpService';

export function uniqueCounter(productID) {
    return http.put(`http://localhost:3900/api/stats/${productID}`)
}

export function regularCounter(productID) {
    return http.put(`http://localhost:3900/api/stats/${productID}/${quantity}`)
}


const ex = {
    uniqueCounter,
    regularCounter
}

export default ex;
